@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:BankComputer a owl:Class .
atm:Message a owl:Class .
atm:Transaction a owl:Class .
atm:Money a owl:Class .
atm:StateValue a owl:Class .
atm:Function a owl:Class .

atm:receives a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Message .

atm:has a owl:ObjectProperty ;
    rdfs:domain atm:Message ;
    rdfs:range atm:Transaction .

atm:from a owl:ObjectProperty ;
    rdfs:domain atm:Message ;
    rdfs:range atm:BankComputer .

atm:dispense a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Money .

atm:succeeded a owl:NamedIndividual ;
    rdf:type atm:StateValue .

atm:TransactionSuccessRule a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:receives ;
                          owl:someValuesFrom [ a owl:Restriction ;
                                               owl:onProperty atm:has ;
                                               owl:someValuesFrom [ a owl:Restriction ;
                                                                    owl:onProperty atm:from ;
                                                                    owl:hasValue atm:succeeded ] ] ] .

atm:DispenseMoneyRule a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:dispense ;
                          owl:someValuesFrom atm:Money ] .

atm:ATM a owl:Class ;
    rdfs:subClassOf atm:TransactionSuccessRule, atm:DispenseMoneyRule .
